import React, { useEffect, useState } from "react";
import { Card } from "react-bootstrap";
import axios from "axios";

const ObjectCard = ({ companyID, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.post("http://localhost:5009/api/getObjCards", {
          companies_id: companyID,
          identifiers: identifiers,
        });

        const { data } = response;

        if (Array.isArray(data)) {
          setObjectCards(data);
        } else {
          console.log("Карточки объектов не найдены");
        }
      } catch (error) {
        console.log("Ошибка при получении карточек объектов:", error);
      }
    };

    fetchData();
  }, [companyID, identifiers]);

  return (
    <div>
      {objectCards.map((objectCard, index) => (
        <Card key={index} border="secondary" style={{ margin: 10 }}>
          <Card.Body>
            <Card.Title>Карточка объекта {index + 1}</Card.Title>
            <Card.Text>
              <strong>Реестровый номер:</strong> {objectCard.registry_number || "Нет записи"} <br />
              <strong>Дата внесения:</strong> {objectCard.date_entry || "Нет записи"} <br />
            </Card.Text>
          </Card.Body>
        </Card>
      ))}
    </div>
  );
};

export default ObjectCard;
